import React, { Component } from 'react'
import history from '@/utils/history'
import _ from 'lodash'
import { Table, Progress } from 'semantic-ui-react'
import Pagination from './Pagination'
import './index.scss'

class TableExamplePagination extends Component {
    getSerialNo = index => {
        return (_.get(this.props.data, 'pageNo') - 1) * 10 + index
    }
    getScheduledTime = scheduledTime => {
        return new Date(scheduledTime)
    }

    deleteCampaign = campaignId => {
        console.log('id of campaign is here', campaignId)
    }
    editCampaign = campaignId => {
        history.push(`/campaign/step-1/${campaignId}`)
    }

    render() {
        const { data, headers, onPageChange, loading } = this.props

        if (!data) {
            return null
        }

        const { campaigns } = data

        return (
            <div>
                <Table striped color={'green'}>
                    {headers && (
                        <Table.Header>
                            <Table.Row>
                                {headers.map(header => (
                                    <Table.HeaderCell key={header.key}>
                                        {header.value}
                                    </Table.HeaderCell>
                                ))}
                            </Table.Row>
                        </Table.Header>
                    )}

                    <Table.Body>
                        {campaigns &&
                            campaigns.map((part, index) => (
                                <Table.Row key={part.campaignId}>
                                    <Table.Cell>{this.getSerialNo(index + 1)}</Table.Cell>
                                    <Table.Cell>{_.capitalize(part.name)}</Table.Cell>
                                    <Table.Cell>{_.capitalize(part.campaignType)}</Table.Cell>
                                    <Table.Cell>{_.capitalize(part.status)}</Table.Cell>
                                    <Table.Cell>{_.capitalize(part.deviceType)}</Table.Cell>
                                    <Table.Cell>
                                        {/* {this.getScheduledTime(part.scheduledTime)} */}
                                        hi
                                    </Table.Cell>
                                    <Table.Cell>
                                        <Progress percent={70} success size="tiny">
                                            Impression : 70%
                                        </Progress>
                                        <Progress percent={90} success size="tiny">
                                            Click : 90%
                                        </Progress>
                                        <Progress percent={10} success size="tiny">
                                            Bounce :10%
                                        </Progress>
                                        <Progress percent={70} success size="tiny">
                                            Browse: 70%
                                        </Progress>
                                    </Table.Cell>
                                    <Table.Cell>
                                        <span
                                            className="action delete"
                                            onClick={() => this.deleteCampaign(part.campaignId)}
                                        />
                                        <span
                                            className="action edit-icon"
                                            onClick={() => this.editCampaign(part.campaignId)}
                                        />
                                    </Table.Cell>
                                </Table.Row>
                            ))}
                    </Table.Body>

                    <Table.Footer>
                        <Table.Row>
                            <Table.HeaderCell colSpan="8">
                                <Pagination
                                    totalPages={data.totalCount}
                                    currentPage={data.pageNo}
                                    onPageChange={onPageChange}
                                    loading={loading}
                                />
                            </Table.HeaderCell>
                        </Table.Row>
                    </Table.Footer>
                </Table>
            </div>
        )
    }
}

export default TableExamplePagination
